interface ButtonProps {
    children: React.ReactNode;
}

const Button: React.FC<ButtonProps> = ({children}) => {
    return <>
        <button className='p-6 border rounded-lg rounded-r-none hover:text-orange-500'>
            { children }
        </button>
    </>
}

export default Button;
